PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "academy_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "academy_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "academy_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "academy_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "academy_alumno" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(30) NOT NULL, "apellido" varchar(30) NOT NULL, "cohorte" smallint unsigned NULL CHECK ("cohorte" >= 0), "fecha_creacion" datetime NOT NULL, "fecha_cambio" datetime NOT NULL, "status" varchar(1) NOT NULL, "email" varchar(254) NULL, "representante_id" bigint NULL REFERENCES "academy_representante" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "academy_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "academy_representante" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(30) NOT NULL, "apellido" varchar(30) NOT NULL, "email" varchar(254) NULL, "fecha_creacion" datetime NOT NULL, "fecha_cambio" datetime NOT NULL, "celular" varchar(15) NULL, "academia_id" bigint NULL REFERENCES "academy_academia" ("id") DEFERRABLE INITIALLY DEFERRED, "sexo" varchar(1) NULL);
CREATE TABLE IF NOT EXISTS "academy_tutor" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(30) NOT NULL, "apellido" varchar(30) NOT NULL, "email" varchar(254) NULL, "fecha_nacimiento" datetime NULL, "celular" varchar(15) NULL, "academia_id" bigint NULL REFERENCES "academy_academia" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "academy_alumno_academias" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "alumno_id" bigint NOT NULL REFERENCES "academy_alumno" ("id") DEFERRABLE INITIALLY DEFERRED, "academia_id" bigint NOT NULL REFERENCES "academy_academia" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "academy_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "tipo_de_usuario" varchar(1) NOT NULL);
CREATE TABLE IF NOT EXISTS "academy_academia" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(30) NOT NULL, "director_id" bigint NULL UNIQUE REFERENCES "academy_user" ("id") DEFERRABLE INITIALLY DEFERRED, "url_imagen" varchar(200) NULL);
CREATE TABLE IF NOT EXISTS "academy_curso" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(50) NOT NULL, "tipo_de_curso" varchar(1) NOT NULL, "cantidad_de_sesiones" smallint unsigned NULL CHECK ("cantidad_de_sesiones" >= 0), "costo_curso_fijo" decimal NULL, "tiempo_de_sesion" smallint unsigned NULL CHECK ("tiempo_de_sesion" >= 0), "costo_por_sesion" decimal NULL);
CREATE TABLE temp_REPS(
  "email" TEXT,
  "Nombre" TEXT,
  "Apellido" TEXT,
  "Celular" TEXT
);
CREATE TABLE IF NOT EXISTS "academy_pago" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "fecha_pago" date NOT NULL, "monto" decimal NOT NULL, "fecha_inicio" date NOT NULL, "alumno_id" bigint NOT NULL REFERENCES "academy_alumno" ("id") DEFERRABLE INITIALLY DEFERRED, "academia_id" bigint NULL REFERENCES "academy_academia" ("id") DEFERRABLE INITIALLY DEFERRED, "total_clases" integer NOT NULL, "curso_id" bigint NULL REFERENCES "academy_curso" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "academy_asistencia" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "alumno_id" bigint NOT NULL REFERENCES "academy_alumno" ("id") DEFERRABLE INITIALLY DEFERRED, "fecha" date NOT NULL, "academia_id" bigint NULL REFERENCES "academy_academia" ("id") DEFERRABLE INITIALLY DEFERRED, "tutor_id" bigint NULL REFERENCES "academy_tutor" ("id") DEFERRABLE INITIALLY DEFERRED, "curso_id" bigint NULL REFERENCES "academy_curso" ("id") DEFERRABLE INITIALLY DEFERRED, "cantidad_sesiones" integer NOT NULL);
